INSERT INTO `config_info` VALUES (860, 'aurora-gateway-dev.yaml', 'THEME-GROUP', 'spring:\n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      scg:\n        fallback:\n          mode: response\n          response-status: 200\n          response-body: \'{\"code\":404,\"data\":{},\"message\":\"请求太快,请稍后在试┭┮﹏┭┮\",\"success\":false}\'\n      transport:\n        port: 8719\n        dashboard: localhost:8080\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${NACOS_HOST:nacos_standalone_host}:${NACOS_PORT:8848}\n            dataId: sentinel-aurora-gateway\n            groupId: ${NACOS_GROUP:DEFAULT_GROUP}\n            data-type: json\n            rule-type: flow\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: openapi\n          uri: http://localhost:${server.port}\n          predicates:\n            - Path=/v3/api-docs/**\n          filters:\n            - RewritePath=/v3/api-docs/(?<path>.*),/$\\{path}/v3/api-docs\n        - id: aurora-admin\n          uri: lb://aurora-admin\n          predicates:\n            - Path=/admin/**\n        - id: aurora-comment\n          uri: lb://aurora-message\n          predicates:\n            - Path=/comment/**\n        - id: aurora-article\n          uri: lb://aurora-article\n          predicates:\n            - Path=/blog/**\n        - id: aurora-file\n          uri: lb://aurora-admin\n          predicates:\n            - Path=/file/**\n        - id: aurora-message\n          uri: lb://aurora-message\n          predicates:\n            - Path=/message/**\n        - id: aurora-auth-server\n          uri: lb://aurora-admin\n          predicates:\n            - Path=/auth/**,/login/**,/oauth/**\n\n\naurora:\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: gateway聚合平台\n      description: 这是Aurora主题的博客后台管理部分api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE', 'c742f72fcd12f7c6a5bfd2bec7647156', '2022-05-20 00:26:18', '2023-10-15 16:53:54', 'nacos', '192.168.176.1', '', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae', '', '', '', 'yaml', '', '');
