INSERT INTO `config_info` VALUES (863, 'aurora-admin-dev.yaml', 'THEME-GROUP', 'spring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST}:${MYSQL_PORT}/aurora_admin?characterEncoding=utf8&connectTimeout=1000&socketTimeout=3000&autoReconnect=true&useUnicode=true&useSSL=false&serverTimezone=UTC\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n# 自定义的配置\naurora:\n  defaultRoleList: \n    - user\n  snow-flake-worker-id: 2\n  snow-flake-datacenter-id: 12\n  account:\n    mail-verify-account-expiration-time: 120000\n    mail-verify-account-prefix-path: http://localhost:7777/admin/verifyAccount/bindEmail\n    enable-account-prefix-path: http://localhost:7777/admin/verifyAccount/enable\n  default:\n    user:\n      site-info: \"{\\\"readme\\\":\\\"# Hi auUsernameua\\\\n\\\",\\\"showWave\\\":true,\\\"showTopImgBubble\\\":true,\\\"mobilePageSidebar\\\":true,\\\"latestPageSize\\\":6,\\\"githubUrl\\\":\\\"https://github.com/xcyeye\\\",\\\"homePageLazyLoadingImg\\\":\\\"https://picture.xcye.xyz/image-20220328221012634.png\\\",\\\"randomPictureInterface\\\":\\\"https://cdn.seovx.com/d/?mom=302\\\",\\\"defaultCoverRequestInterface\\\":\\\"https://cdn.seovx.com/d/?mom=302\\\",\\\"footerInfo\\\":{\\\"enable\\\":true,\\\"isShowThemeCopyright\\\":true,\\\"isShowRunTime\\\":true,\\\"prefixRuntime\\\":\\\"Aurora博客系统\\\",\\\"backgroundImage\\\":\\\"https://w.wallhaven.cc/full/x6/wallhaven-x68r2l.jpg\\\",\\\"footInfo\\\":[\\\"Copyright©byxcyeAllRightsReserved.\\\",\\\"<atarget=\'_blank\'href=\'http://www.beian.gov.cn/portal/registerSystemInfo?recordcode=53060202000142\'style=\'display:inline-block;text-decoration:none;height:20px;line-height:20px;\'><imgsrc=\'\'style=\'float:left;\'/><pstyle=\'float:left;height:20px;line-height:20px;margin:0px0px0px5px;\'>滇公网安备53060202000142号</p></a>\\\"]},\\\"friendLinkSiteInformation\\\":{\\\"title\\\":\\\"Aurora博客系统\\\",\\\"url\\\":\\\"http://xcye.xyz/user/1522074993315815424\\\",\\\"logo\\\":\\\"http://127.0.0.1/aurora-upload/jpg/2023/1/illust_86447159_20220928_0809051673786145660.jpg\\\",\\\"cover\\\":\\\"https://w.wallhaven.cc/full/o5/wallhaven-o559j7.jpg\\\",\\\"describe\\\":\\\"Aurora博客系统和Aurora主题作者\\\",\\\"contact\\\":\\\"2291308094\\\"},\\\"socialsArr\\\":[{\\\"aHref\\\":\\\"tencent://message/?uin=2291308094\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":true,\\\"icon\\\":\\\"fa:qq\\\",\\\"color\\\":\\\"#90f1ef\\\",\\\"showImgSrc\\\":\\\"\\\"},{\\\"aHref\\\":\\\"https://github.com/xcyeye/\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":true,\\\"icon\\\":\\\"fa:github\\\",\\\"color\\\":\\\"#bbe6e4\\\",\\\"showImgSrc\\\":\\\"\\\"},{\\\"aHref\\\":\\\"https://space.bilibili.com/483962286\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":true,\\\"icon\\\":\\\"fa-brands:envira\\\",\\\"color\\\":\\\"efd1cd\\\",\\\"showImgSrc\\\":\\\"\\\"},{\\\"aHref\\\":\\\"https://music.163.com/#/user/home?id=1411050784\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":true,\\\"icon\\\":\\\"fa:music\\\",\\\"color\\\":\\\"#6fffe9\\\",\\\"showImgSrc\\\":\\\"\\\"},{\\\"aHref\\\":\\\"mailto:2291308094@qq.com\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":true,\\\"icon\\\":\\\"fa:envelope\\\",\\\"color\\\":\\\"#f2b5d4\\\",\\\"showImgSrc\\\":\\\"\\\"},{\\\"aHref\\\":\\\"/friendLink/1522074993315815424\\\",\\\"isHome\\\":true,\\\"show\\\":true,\\\"sidebar\\\":false,\\\"icon\\\":\\\"fa:paper-plane\\\",\\\"color\\\":\\\"#b8f2e6\\\",\\\"showImgSrc\\\":\\\"\\\"}]}\"\n      welcome-article: \'# HI 你好世界\'\n      navbar-info: \"[{\\\"name\\\":\\\"首页\\\",\\\"url\\\":\\\"/user/auUserUidua\\\",\\\"icon\\\":\\\"fa:home\\\",\\\"children\\\":[]},{\\\"name\\\":\\\"友情链接\\\",\\\"url\\\":\\\"/friendLink/auUserUidua\\\",\\\"icon\\\":\\\"fa:paper-plane\\\",\\\"children\\\":[]},{\\\"name\\\":\\\"关于\\\",\\\"url\\\":\\\"/about/auUserUidua\\\",\\\"icon\\\":\\\"fa:pagelines\\\",\\\"outLink\\\":false,\\\"children\\\":[]},{\\\"name\\\":\\\"评论\\\",