alse,\"children\":[]},{\"name\":\"说说\",\"url\":\"\",\"icon\":\"fa:comments\",\"outLink\":false,\"children\":[]}]\'\n    avatar: https://picture.xcye.xyz/avatar.jpg\n    role: ROLE_user\n    permission: user\n    nickname: aurora-new\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: 博客后台API\n      description: 这是Aurora主题的博客后台管理部分api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE\n  amqp:\n    exchanges:\n      # 发送邮件的交换机\n      - exchange: aurora.send.email.common.exchange\n        exchange-type: topic\n        dead-letter-exchange: aurora.send.email.dead.letter.exchange\n        dead-letter-exchange-type: direct\n        queues:\n          # 发送html邮件\n          - queue: send.html.mail.queue\n            dead-letter-queue: send.html.mail.dead.letter.queue\n            routing-key: send.html.amil.routing\n            dead-letter-routing-key: send.html.mail.dead.letter.routing\n\n          - queue: send.simple.text.mail.queue\n            dead-letter-queue: send.simple.text.mail.dead.letter.queue\n            routing-key: send.simple.text.mail.routing\n            dead-letter-routing-key: send.simple.text.mail.dead.letter.routing\n            # 发送错误消息的交换机\n      - exchange: aurora.send.mistake.exchange\n        exchange-type: topic\n        dead-letter-exchange: aurora.send.mistake.dead.letter.exchange\n        dead-letter-exchange-type: direct\n        queues:\n          - queue: aurora.mistake.queue\n            dead-letter-queue: aurora.mistake.dead.letter.queue\n            routing-key: aurora.mistake.routing.key\n            dead-letter-routing-key: aurora.mistake.dead.letter.routing.key\n              # 发送操作用户数据的交换机\n      - exchange: aurora.send.operate.user.exchange\n        exchange-type: topic\n        dead-letter-exchange: aurora.send.operate.user.dead.letter.exchange\n        dead-letter-exchange-type: direct\n        queues:\n          - queue: aurora.operate.user.binding.email.queue\n            dead-letter-queue: aurora.operate.user.binding.email.dead.letter.queue\n            routing-key: aurora.operate.user.binding.email.routing\n            dead-letter-routing-key: aurora.operate.user.binding.email.dead.letter.routing\n\n          - queue: aurora.operate.user.lock.account.queue\n            dead-letter-queue: aurora.operate.user.lock.account.dead.letter.queue\n            routing-key: aurora.operate.user.lock.account.routing.key\n            dead-letter-routing-key: aurora.operate.user.lock.account.dead.letter.routing.key\n\n          - queue: aurora.update.role.permission.queue\n            dead-letter-queue: aurora.update.role.permission.dead.letter.queue\n            routing-key: aurora.update.role.permission.routing.key\n            dead-letter-routing-key: aurora.update.role.permission.dead.letter.routing\n\n          - queue: aurora.update.white.url.queue\n            dead-letter-queue: aurora.update.white.url.dead.letter.queue\n            routing-key: aurora.update.white.url.routing.key\n            dead-letter-routing-key: aurora.update.white.url.dead.letter.routing\n              # 发送评论的交换机\n      - exchange: aurora.send.comment.exchange\n        exchange-type: topic\n        dead-letter-exchange: aurora.send.comment.dead.letter.exchange\n        dead-letter-exchange-type: direct\n        queues:\n          - queue: aurora.PAGE.comment.queue\n            dead-letter-queue: aurora.PAGE.comment.dead.letter.queue\n            routing-key: aurora.PAGE.routingKey\n            dead-letter-routing-key: aurora.PAGE.comment.dead.letter.routingKey\n    default-max-length: 25\n    default-ttl: 6000\nlogging:\n  level:\n    xyz.xcye.web.common.service.feign.MessageLogFeignService: DEBUG', '3dac7e4ea954bf53557b1ea39424aa06', '2022-05-20 00:40:39', '2023-10-10 23:56:19', 'nacos', '172.29.0.1', '', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae'