INSERT INTO `his_config_info` VALUES (859, 1524, 'aurora-comment-dev.yaml', 'THEME-GROUP', '', 'spring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST}:${MYSQL_PORT}/aurora_comment?characterEncoding=utf8&connectTimeout=1000&socketTimeout=3000&autoReconnect=true&useUnicode=true&useSSL=false&serverTimezone=UTC\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n\naurora:\n  snow-flake-datacenter-id: 5\n  snow-flake-worker-id: 23\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: 博客评论API\n      description: 这是Aurora主题的博客评论api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE', '77dcd02e21700abd45bef698857ce92b', '2023-10-15 02:04:48', '2023-10-15 10:04:49', 'nacos', '192.168.144.1', 'U', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae', '');
INSERT INTO `his_config_info` VALUES (858, 1525, 'aurora-file-dev.yaml', 'THEME-GROUP', '', 'spring:\n  servlet:\n    multipart:\n      max-file-size: 150MB\n      max-request-size: 500MB\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST}:${MYSQL_PORT}/aurora_file?characterEncoding=utf8&connectTimeout=1000&socketTimeout=3000&autoReconnect=true&useUnicode=true&useSSL=false&serverTimezone=UTC\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n\n\n# 自定义的配置\naurora:\n  file:\n    nginx-root-path: F:\\opt\\aurora-theme\\nginx-upload\n    nginx-server-name: http://127.0.0.1\n    save-file-folder: aurora-upload\n  snow-flake-worker-id: 12\n  snow-flake-datacenter-id: 23\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: 博客文件API\n      description: 这是Aurora主题的博客文件api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE', '82593369b2bfbdf69ec7f8a4f342a257', '2023-10-15 02:06:45', '2023-10-15 10:06:45', 'nacos', '192.168.144.1', 'U', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae', '');
INSERT INTO `his_config_info` VALUES (855, 1526, 'aurora-auth-server-dev.yaml', 'THEME-GROUP', '', 'spring:\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://${MYSQL_HOST}:${MYSQL_PORT}/aurora_auth_server?characterEncoding=utf8&connectTimeout=1000&socketTimeout=3000&autoReconnect=true&useUnicode=true&useSSL=false&serverTimezone=UTC\n    username: ${MYSQL_USERNAME}\n    password: ${MYSQL_PASSWORD}\n\nlogging:\n  level:\n    xyz.xcye.web.common.service.feign.MessageLogFeignService: DEBUG\naurora:\n  oauth:\n    access-token-validity-seconds: 259200\n    refresh-token-validity-seconds: 259200\n    redis-delete-retry: 4\n    max-login-failure: 4\n    re-login-minute: 5\n    tx-map-api: https://apis.map.qq.com/ws/location/v1/ip?key=PU6BZ-VVO6V-66QP2-UNRJQ-K2JCO-24BCX\n  snow-flake-datacenter-id: 1\n  snow-flake-worker-id: 2\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: 认证中心API\n      description: 这是Aurora主题的博客的认证中心api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE', 'a669ba70f15b20774414ea9d6959afb2', '2023-10-15 02:09:47', '2023-10-15 10:09:48', 'nacos', '192.168.144.1', 'U', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae', '');
INSERT INTO `his_config_info` VALUES (860, 1527, 'aurora-gateway-dev.yaml', 'THEME-GROUP', '', 'spring:\n  cloud:\n    sentinel:\n      filter:\n        enabled: false\n      scg:\n        fallback:\n          mode: response\n          response-status: 200\n          response-body: \'{\"code\":404,\"data\":{},\"message\":\"请求太快,请稍后在试┭┮﹏┭┮\",\"success\":false}\'\n      transport:\n        port: 8719\n        dashboard: localhost:8080\n      datasource:\n        ds1:\n          nacos:\n            server-addr: localhost:8848\n            dataId: sentinel-aurora-gateway\n            groupId: DEFAULT_GROUP\n            data-type: json\n            rule-type: flow\n    gateway:\n      discovery:\n        locator:\n          enabled: true\n      routes:\n        - id: openapi\n          uri: http://localhost:${server.port}\n          predicates:\n            - Path=/v3/api-docs/**\n          filters:\n            - RewritePath=/v3/api-docs/(?<path>.*),/$\\{path}/v3/api-docs\n        - id: aurora-admin\n          uri: lb://aurora-admin\n          predicates:\n            - Path=/admin/**\n        - id: aurora-comment\n          uri: lb://aurora-comment\n          predicates:\n            - Path=/comment/**\n        - id: aurora-article\n          uri: lb://aurora-article\n          predicates:\n            - Path=/blog/**\n        - id: aurora-file\n          uri: lb://aurora-file\n          predicates:\n            - Path=/file/**\n        - id: aurora-message\n          uri: lb://aurora-message\n          predicates:\n            - Path=/message/**\n        - id: aurora-auth-server\n          uri: lb://aurora-auth-server\n          predicates:\n            - Path=/auth/**,/login/**,/oauth/**\n\n\naurora:\n  swagger:\n    author:\n      name: aurora\n      url: https://aurora.xcye.xyz\n      email: 2291308094@qq.com\n    api-info:\n      title: gateway聚合平台\n      description: 这是Aurora主题的博客后台管理部分api\n      version: 1.0.0\n      license: MIT\n      license-url: https://github.com/vuepress-aurora/vuepress-theme-aurora/blob/master/LICENSE', '868351fc7508bb200e40078c720a25dc', '2023-10-15 02:15:55', '2023-10-15 10:15:56', 'nacos', '192.168.144.1', 'U', 'a6b1905f-d8c6-4a43-8f21-fe662f62bdae', '');
